export const Card = (card) => {

    function handleClick() {
        props.onCardClick(props.card);
      }   

    return(
        <li class="element">
            <button class="element__back" tupe="button"></button>
            <img className="element__foto" src={props.card.link} alt={props.card.name} onClick={handleClick()} />
            <h2 className="element__title">{props.card.name}</h2>
            <div className="element__like-form">
                <button className="element__like" type="button"></button>
                <div className="element__like-count">{props.card.likes.length}</div>
            </div>
        </li>
    )
}
